tool_details:
[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "ddbj"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX nuc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX sio: <http://semanticscience.org/resource/>

SELECT ?locus_tag ?product ?protein_id
FROM <http://rdfportal.org/dataset/ddbj>
WHERE {
  ?gene a nuc:Gene ;
        nuc:locus_tag ?locus_tag .
  ?cds sio:SIO_010081 ?gene ;
       nuc:product ?product ;
       rdfs:seeAlso ?protein_id .
  FILTER(CONTAINS(STR(?protein_id), "ncbiprotein"))
  FILTER(CONTAINS(STR(?gene), "CP036276.1"))
  FILTER(?locus_tag = "Mal52_08030")
}"}}]

[{"name": "mcp__togomcp__get_sparql_endpoints", "input": {}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "reactome"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT (COUNT(DISTINCT ?proteinRef) AS ?count)
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?proteinRef a bp:ProteinReference ;
    bp:xref ?xref .
  ?xref a bp:UnificationXref ;
    bp:db "UniProt"^^xsd:string ;
    bp:id ?uniprotId .
}"}}]
